Answer: In this exercise, we are to determine business intelligence and its purpose.
## Business Intelligence&nbsp;
Business intelligence is referred to as the systems and processes used in the analysis of data pertaining to a business in order to assist the business in making informed decisions.

## Purpose of Business Intelligence&nbsp;
Business intelligence is used in order to compile reports that contain the data needed in the analysis of the performance of the business. These reports are used to determine the business's goals
